{"query":"query {
    repository(owner: "{REPOSITORY_OWNER}", name: "{REPOSITORY_NAME}") {
    pullRequests(states: MERGED, last: 100{REPOSITORY_BRANCH_NAME_REPLACER}) {
      edges {
        node {
          number
          createdAt
          mergedAt
        }
      }
    }
  }
}","variables":{}}

{"query":"{
  repository(owner: "{REPOSITORY_OWNER}", name: "{REPOSITORY_NAME}") {
    {REPOSITORY_BRANCH_NAME_REPLACER} {
      name
      branchProtectionRule {
        allowsDeletions
        allowsForcePushes
      }
    }
  }
}","variables":{}}
